<div class="entities" style="line-height: 2.5; direction: ltr">Short-term biomarker modulation prevention study of anastrozole in women at increased risk for second primary breast cancer . The selective estrogen receptor modulators ( SERM ) , Tamoxifen and raloxifen reduce risk breast cancer . Patient acceptance of SERMs for breast cancer prevention is low due to toxicities . New agents with a better toxicity profile are needed .

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">The promotion of iron-induced generation of reactive oxygen species in nerve tissue by aluminum . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01370
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 is suspected to play a role in several neurological disorders . Reactive oxygen species ( ROS ) lead to oxidative stress , which is thought to be a possible mechanism for neurological damage . Interactions between aluminum and iron , a known promoter of prooxidant events , were studied in cerebral tissues using a fluorescent probe to measure rates of generation of ROS . Al2 ( SO4 ) 3 alone failed to stimulate ROS production over a wide range of concentrations ( 50-1000 microM ) . The aluminum-deferrioxamine chelate in the absence of iron could also not potentiate ROS formation . However , Al2 ( SO4 ) 3 potentiated FeSO 4 - induced ROS , with a maximal effect at 10 microM Fe and 500 microM Al . DB01575 , a hydrated aluminum silicate , did not potentiate iron-induced ROS formation . Ferritin had a minor stimulatory effect on ROS generation , but this was not potentiated by the concurrent presence of Al2 ( SO4 ) 3 . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P02787
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 had no effect on basal rates of ROS generation , but when Al2 ( SO4 ) 3 was also present , ROS production was enhanced . It is concluded that : 1 . There is a potentiation of iron-induced ROS by aluminum salts ; 2 . Free or complexed aluminum alone is not a key producer of ROS ; and 3 . High rates of ROS production are unlikely to be owing to the displacement by aluminum iron from its biologically sequestered locations .</div>

<h2 style="margin: 0">10</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275

</mark>
 abnormalities in identical twins with oligospermia . Clinical and biochemical studies . Identical twin brothers presented with oligospermia , small testes , normal male phenotypes , elevated serum luteinizing hormone levels , and normal or elevated serum testosterone levels . Both men had low to low-normal cytosol androgen receptor binding capacity in cultured fibroblasts from pubic skin biopsy specimens . Qualitative abnormalities of cellular androgen receptors were suggested by low-normal or low nuclear androgen uptake in fibroblasts from both brothers as well as abnormal thermolability and subnormal molybdate stabilization of androgen receptors from one brother . In vivo androgen sensitivity was assessed in one twin following administration of testosterone or the non-aromatizable androgen fluoxymesterone . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01185
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 suppressed serum luteinizing hormone and serum testosterone / estradiol-binding globulin , and although testosterone suppressed both serum luteinizing hormone and serum follicle-stimulating hormone , the suppression of serum luteinizing hormone by testosterone was subnormal . Both subjects showed marked exaggeration of the serum 17 - hydroxyprogesterone increase after administration of human chorionic gonadotropin , despite normal serum testosterone increases , suggesting a block in testicular 17,20- desmolase , which converts 17 - hydroxyprogesterone to testosterone . These studies suggest that oligospermia and block of the enzyme 17,20- desmolase may be the earliest manifestations of androgen resistance , and the finding of the syndrome of oligospermia , normal male phenotype , and androgen receptor abnormalities in identical twins indicates a genetic etiology of this disorder .</div>

 polymorphism and cinacalcet sensitivity , though in patients with severe

<div class="entities" style="line-height: 2.5; direction: ltr">Embryo transfer induces a subclinical endometritis in recipient mares which can be prevented by treatment with non-steroid anti-inflammatory drugs . We tested the hypothesis that subclinical endometritis occurs after embryo transfer ( ET ) in the horse . Recipient mares were treated with meclofenamic acid ( M ) or flunixin meglumin ( F ) after ET or were left untreated ( n = 9 per group ) . Embryos were re-collected 4 days after transfer . Endometrial biopsies were taken for histology and analysis of cyclooxygenase - 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 ) by immunohistochemistry and for PCR . Bacteriological swabs were collected from the uterus and lavage fluid of donor and recipient mares . Progesterone and prostaglandin F ( 2alpha ) release was analysed in recipient mares after ET . Four days after ET , four embryos were recovered from group M and three from group F and untreated mares , each . The number of polymorph nuclear neutrophils was reduced in treated mares ( p &lt; 0.05 ) . Expression of mRNA for inflammatory cytokines did not differ between groups . In group M , expression of endometrial prostaglandin-E-synthase was higher than in group F ( p &lt; 0.05 ) . Three out of nine control mares underwent preterm luteolysis ( p &lt; 0.05 vs . treatment groups ) , prostaglandin release ( p &lt; 0.05 ) and the number of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 positive cells ( p &lt; 0.01 ) were significantly higher than in treated mares . Only few bacteriological swabs were positive . In conclusion , treatment of embryo recipient mares with non-steroid anti-inflammatory drugs inhibits the inflammatory response of the endometrium after ET .
